def GetIntArray(number):
	result = []
	while number:
		result.insert(0,number % 10)
		number //= 10
	if result == []:
		result = [0]
	return result

def MakePattern(inputList):
	listPattern = []
	basePattern = [0,1,0,-1]
	bigPattern = [1,0,-1,0]
	for i in range(2,len(inputList)+2):
		for b in range(len(basePattern)):
			bigPattern.insert(i*b,basePattern[b])
		listPattern.append(bigPattern)
	return listPattern

